webpackJsonp([0xd49fc30c34c7],{346:function(A,e){A.exports={data:{markdownRemark:{html:"<p>Samlingen be skrevet i København i 1865, og gitt til Nina i julegave.<br>\nSamlingen nr. 3, Jeg elsker deg ble i løpet av noen tiår trykt i 60.000 særtrykk av Griegs forlegger Peters. Det finnes også over 300 plateinnspillinger av sangen, den første ble gjort i London i 1899 av den danske sangerinnen Otta Brønnum. Første norske innspilling ble gjort av Cally Monrad i 1905. Frank Sinatra og Bing Crosby har også sunget den inn. Nina sang Hjertets melodier på hennes og Edvard første konsert i Kristiania i 1866</p>",timeToRead:1,excerpt:"Samlingen be skrevet i København i 1865, og gitt til Nina i julegave. Samlingen nr. 3, Jeg elsker deg ble i løpet av noen tiår trykt i 6…",id:"/Users/thomasheimstad/Sites/Obo/src/posts/opus5.md absPath of file >>> MarkdownRemark",frontmatter:{workname:"Hjertets melodier",dedicatedTo:"Hans Christian Andersen",artists:["Jack Jackson","Test Testesen"],medialink:null,composedin:"1865",title:"5",author:"Lane Pryce",date:"2017-11-25T20:04:44.484Z",category:"opus",tags:["sang","piano"],thumbnail:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/static/FjordInDramaticSkies-dc4d10775383aead854a2eec41fee76a-47774.jpg",srcSet:"/static/FjordInDramaticSkies-dc4d10775383aead854a2eec41fee76a-45ad6.jpg 480w,\n/static/FjordInDramaticSkies-dc4d10775383aead854a2eec41fee76a-e2fcf.jpg 960w,\n/static/FjordInDramaticSkies-dc4d10775383aead854a2eec41fee76a-47774.jpg 1920w",sizes:"(max-width: 1920px) 100vw, 1920px"}}}},fields:{slug:"/opus5/",artist:null,opuses:null}}},pathContext:{slug:"/opus5/"}}}});
